(4, '58b7f9a0bf7fc5e650bb7ab52c82ed381613560146602cf952807b55.17116350', 'Note', 'Mqolomba Park- Amendment form', 'This asset has the following components\r\n1. Land. Asset ID:  201100142, The other land with asset ID 201900471  must be removed on FAR  Any costs realised must be added to Asset ID 201100142. \r\n2. Based on directorate information was recorded\r\n2.1 Civil/Structural\r\n2.1.1 Park Asset ID: 201100141 \r\n2.1.2 Outdoor Gym equipment Asset ID: 201100141, the asset ID: 202000011 recorded on FAR must be removed  any costs realised must be added on Asset ID: 201100141\r\n2.1.3 Playground Equipment. Asset ID: 201100141 \r\n2.1.4 Civil/Structural. Asset ID: 201100141, the other civil structural with asset ID 201900472 must be removed on FAR  Any costs realised must be added to Asset ID 201100141 .\r\nParent Asset ID: 201800055 must be removed from FAR', 'No', '2021-04-16 10:26:08', '2021-05-24 13:11:03'),
