INSERT INTO `property_lessee_type` (`id`, `type`, `description`, `deleted`, `date`) VALUES
(15, 'Financial Lease', 'Financial leasing is a contract involving payment over a longer period. It is a long-term lease and the lessee will be paying much more than the cost of the property or equipment to the lessor in the form of lease charges. It is irrevocable. In this type of leasing the lessee has to bear all costs and the lessor does not render any service.', '', '2019-10-17 14:42:19'),
(2, 'Operating Lease', 'In an operating lease, the lessee uses the asset for a specific period. The lessor bears the risk of obsolescence and incidental risks. There is an option to either party to terminate the lease after giving notice.', '', '2019-10-01 08:29:27'),
(3, 'Specialized service lease', 'The lessor or the owner of the asset is a specialist of the asset which he is leasing out. He not only leases out but also gives specialized personal service to the lessee. Examples are electronic goods, automobiles, air-conditioners, etc.', '', '2019-10-01 08:31:05'),
(4, 'Leveraged and non-leveraged leases', 'In leveraged and  non-leveraged leases, the value of the asset leased may be of a huge amount which may not be possible for the lessor to finance. So, the lessor involves one more financier who will have charge over the leased asset.', '', '2019-10-01 08:30:40'),
(5, 'Conveyance type lease', 'In Conveyance type lease, the lease will be for a long-period with a clear intention of conveying the ownership of title on the lessee.', '', '2019-10-23 13:03:47'),
(6, 'Sale and leaseback', 'In a sale and leaseback, a company owning the asset sells it to the lessor. The lessor pays immediately for the asset but leases the asset to the seller. Thus, the seller of the asset becomes the lessee. The asset remains with the seller who is a lessee but the ownership is with the lessor who is the buyer. This arrangement is done so that the selling company obtains finance for running the business along with with the asset.', '', '2019-10-01 08:30:40'),
(7, 'Full and non pay-out lease', 'A full pay-out lease is one in which the lessor recovers the full value of the leased asset by way of leasing. In case of a non pay-out lease, the lessor leases out the same asset over and over again.', '', '2019-10-01 08:30:40'),
(8, 'Net and non-net lease', 'In non-net lease, the lessor is in charge of maintenance insurance and other incidental expenses. In a net lease, the lessor is not concerned with the above maintenance expenditure. The lessor confines only to financial service.', '', '2019-10-01 08:31:38'),
(9, 'Sales aid lease', 'In case, the lessor enters into any tie up arrangement with manufacturer for the marketing, it is called sales aid lease.', '', '2019-10-01 08:31:38'),
(10, 'Cross border lease', 'Lease across national frontiers are called cross border lease, Shipping, air service, etc., will come under this category.', '', '2019-10-01 08:32:04'),
(11, 'Tax oriented lease', 'Where the lease is not a loan on security but qualifies as a lease, it will be considered a tax oriented lease.', '', '2019-10-01 08:32:04'),
(12, 'Import Lease', 'In an Import lease, the company providing equipment for lease may be located in a foreign country but the lessor and the lessee may belong to the same country. The equipment is more or less imported.', '', '2019-10-01 08:32:29'),
(13, 'International lease', 'Here, the parties to the lease transactions may belong to different countries which is almost similar to cross border lease.', '', '2019-10-01 08:32:29');
